        <div className="product-image">
          <img src={product1Image} alt="Product" />
        </div>
        <div className="product-details">
          <h2 className="product-title">Black Pearl</h2>
          <p className="product-description">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam consectetur libero nec dui lobortis, nec aliquet risus ultrices. 
            Nulla auctor, leo non bibendum malesuada, lorem ipsum dolor sit amet, consectetur adipiscing elit.
          </p>
          <p className="product-price">$49.99</p>
          <button className="buy-button">Buy Now</button>
        </div>
      </div>
    );
  };
  
  export default Product1;
